elementClick.customFunction:
const targetElement = $($event.target).closest('#settings', widgetContext.$container[0]);

var type = decodeURIComponent($(targetElement).attr('data-device-type'));

var stateId = getSettingsState(type);

var params = {
    selectedDevice: {
        entityId: entityId,
        entityName: entityName,
        entityLabel: entityLabel,
    },
    targetEntityParamName: 'selectedDevice'
};

widgetContext.actionsApi.openDashboardStateInPopover($event, stateId, params, true, 'bottomRight', true, '400px', getSettingsHeight(type));

function getSettingsState(type) {
    switch (type) {
        case 'Gateway':
            return 'gateway_settings';
        case 'Freezer':            
            return 'freezer_settings';
        case 'Chiller':            
            return 'chiller_settings';                      
        case 'Smart Bin':
            return 'smart_bin_settings';          
        case 'Passage':
            return 'passage_settings';
        case 'Water':
            return 'water_settings';
        case 'Tof':
            return 'tof_settings';
        case 'Occupancy Sensor':
            return 'occupancy_sensor_settings';
        case 'Odour':
            return 'odour_settings';
        default:
            return 'unknown_settings';
    }
}

function getSettingsHeight(type) {
    switch (type) {
        case 'Gateway':
            return '340px';
        case 'Freezer':            
            return '500px';
        case 'Chiller':            
            return '500px';                  
        case 'Smart Bin':
            return '500px';                  
        case 'Passage':
            return '500px';
        case 'Water':
            return '500px';
